-- ----------------------------
-- Table structure for `think_article`
-- ----------------------------
DROP TABLE IF EXISTS `think_article`;
CREATE TABLE `think_article` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0',
  `author` varchar(15) NOT NULL COMMENT '文章作者',
  `subject` varchar(256) NOT NULL COMMENT '文章标题',
  `message` mediumtext NOT NULL COMMENT '文章内容',
  `number` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '点击次数',
  `groom` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '推荐次数',
  `comment` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '评论次数',
  `collect` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '收藏次数',
  `sort` int(11) NOT NULL COMMENT '排序置顶用的',
  `createtime` datetime NOT NULL COMMENT '创建时间',
  `lastmodifytime` datetime NOT NULL COMMENT '修改时间',
  `type` int(11) unsigned NOT NULL COMMENT '文章类型（0HTML1javascript2jquery3MySQL4php5Linux）',
  `status` int(11) unsigned NOT NULL DEFAULT '2' COMMENT '类型（1管理员2用户）',
  `review` int(11) NOT NULL DEFAULT '0' COMMENT '审核（0未通过.1通过2正在审核3余额不足）',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=159 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of think_article
-- ----------------------------

