-- Table structure for `think_collect`
-- ----------------------------
DROP TABLE IF EXISTS `think_collect`;
CREATE TABLE `think_collect` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL COMMENT '用户',
  `collect_id` int(11) unsigned NOT NULL COMMENT '收藏的文章可以连接article表',
  `time` datetime DEFAULT NULL COMMENT '收藏时间',
  `type` int(11) NOT NULL DEFAULT '1' COMMENT '1未收藏2收藏成功',
  PRIMARY KEY (`id`),
  KEY `id` (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

