CREATE TABLE `think_points_record` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned DEFAULT NULL,
  `point` int(11) DEFAULT NULL COMMENT 'user表points是剩余积分这里是积分记录',
  `time` datetime DEFAULT NULL,
