INSERT INTO `think_article` VALUES ('116', '17', '宁静致远', '爆冷夫妻,生活多欢笑', '<ul style=\"margin:0px;padding:0px;list-style:none;font-size:14px;line-height:23px;white-space:normal;background-color:#ffffff;\"><span id=\"text110\" style=\"color:#333333\"><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">1、老婆：“你1000多就买了杆？难道鱼会因为鱼杆贵就上钩吗？！！！！”<br style=\"margin:0px;padding:0px;\" />老公：“我一个杆子都比不上你的一瓶化妆品，难道我会因为你丑就抛弃你吗？！！”</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">2、儿子：什么是低投入高回报？<br style=\"margin:0px;padding:0px;\" />老婆：就是你爸花很少的钱，娶了我这么漂亮的老婆。<br style=\"margin:0px;padding:0px;\" />老公：要不是不小心让你怀了孕，我会娶你？<br style=\"margin:0px;padding:0px;\" />老婆：要不是让我怀孕的那个没良心的男人跑了，我怎么可能嫁给你！</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">3、我做家务，老婆总能挑出毛病来。昨天洗完碗，看见老婆拿起不锈钢锅来反复看，不时地点点头。<br style=\"margin:0px;padding:0px;\" />我赶紧上前：“怎么样，洗得够干净吧。”<br style=\"margin:0px;padding:0px;\" />老婆撩了一下头发说：“没注意，我就是照一下头发。”</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">4、老婆下班回来，兴奋的扬了扬手中的菜：“老公，我在网上新学了一个菜，晚上我做着让你尝尝！”<br style=\"margin:0px;padding:0px;\" />我：“好啊好啊，今晚有口福咯！”<br style=\"margin:0px;padding:0px;\" />等我将食材洗净备好满心欢喜的期待时，只见她擎着手机倚着墙道：“老公，你来掌勺、我来说说步骤。。。”<br style=\"margin:0px;padding:0px;\" />我。。。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">5、我正在打扫卫生，老公往地上扔了张卫生纸，<br style=\"margin:0px;padding:0px;\" />我怒火中烧揪着他的耳朵吼：刚刚扫好的地你又乱扔垃圾，耳朵不想要了么？<br style=\"margin:0px;padding:0px;\" />他委屈的看着我不说话。<br style=\"margin:0px;padding:0px;\" />我继续吼：再有下次就把你耳朵揪下来，知道错哪了么？<br style=\"margin:0px;padding:0px;\" />他：知道了。&nbsp;<br style=\"margin:0px;padding:0px;\" />我问：错哪了<br style=\"margin:0px;padding:0px;\" />他：我不该长耳朵。<br style=\"margin:0px;padding:0px;\" />我。。。</p></span></ul><p><br /></p>', '15', '0', '0', '0', '0', '2016-07-08 21:55:06', '0000-00-00 00:00:00', '8', '1', '1');
INSERT INTO `think_article` VALUES ('117', '17', '宁静致远', '别看爸妈年纪大,笑果一点也不差', '<ul style=\"margin:0px;padding:0px;list-style:none;font-size:14px;line-height:23px;white-space:normal;background-color:#ffffff;\"><span id=\"text110\" style=\"color:#333333\"><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">1、今天听汪峰的《春天里》：“如果有一天，我悄然离去，请把我埋在，在这春天里，春天里。。。”<br style=\"margin:0px;padding:0px;\" />老妈边笑边说：“他要是夏天死了，还要等来年春天再埋啊。”<br style=\"margin:0px;padding:0px;\" />我。。。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">2、“爸，借我十块钱，我想买包烟！”<br style=\"margin:0px;padding:0px;\" />爸爸：你这孩子，结婚孩子都这么大了，连十块钱也没有吗？<br style=\"margin:0px;padding:0px;\" />他苦笑道：这不，您儿媳妇她看的太严！<br style=\"margin:0px;padding:0px;\" />爸爸叹了口气：唉，可怜地孩子，你等我去屋里给你拿，看好了，看到你妈回来要咳嗽一声。。。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">3、我问老妈：“如果有人拿十万换我，你换不换呀？”<br style=\"margin:0px;padding:0px;\" />老妈和蔼的对我说：“傻瓜，我只有你一个女儿，你说我怎么舍得？”<br style=\"margin:0px;padding:0px;\" />我顿时感动的热泪盈眶，老妈看了看远方：“没有百十万，免谈！”</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">4、我和我爸长得很像，大家都说一个模子刻出来的。这固然很好，但也有很多的困扰。<br style=\"margin:0px;padding:0px;\" />比如我妈跟我爸吵过架以后，老妈一看到我和爸那相似的脸，就又来气，把我又骂一顿！</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">5、我爸的网名：点点爸，我妈的网名：点点妈。<br style=\"margin:0px;padding:0px;\" />不知道的都以为我叫点点，点点其实是我家的狗！</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">6、一室友会武术拳法，一看就很专业，我问他。<br style=\"margin:0px;padding:0px;\" />我：你这拳法是跟谁学的？<br style=\"margin:0px;padding:0px;\" />他：我爸，他从小就练这个的。<br style=\"margin:0px;padding:0px;\" />我：你小时候淘气时，你爸打你狠吗？<br style=\"margin:0px;padding:0px;\" />他：我爸从未打过我，打我的是我妈！<br style=\"margin:0px;padding:0px;\" />我：你妈也练拳法吗？<br style=\"margin:0px;padding:0px;\" />他：不是。<br style=\"margin:0px;padding:0px;\" />我：你真幸运！<br style=\"margin:0px;padding:0px;\" />他：幸运个屁，我妈从小练得是棍法！</p></span></ul><p><br /></p>', '14', '0', '0', '0', '0', '2016-07-08 21:56:01', '0000-00-00 00:00:00', '8', '1', '1');
INSERT INTO `think_article` VALUES ('118', '17', '宁静致远', '爆笑之逗B剧场第十季', '<ul style=\"margin:0px;padding:0px;list-style:none;font-size:14px;line-height:23px;white-space:normal;background-color:#ffffff;\"><span id=\"text110\" style=\"color:#333333\"><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">1、我对象很好。。。象也对我很好，我爱动物。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">2、你离开后，我的生活一片黑暗，没有一丝光亮，大大的提高了睡眠质量。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">3、当时年纪小，喜欢装文艺，现在病好了，只喜欢钱。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">4、现在的“晚安”的意思就是你别和我瞎BB了，我现在要继续玩手机了。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">5、以前觉得谈恋爱可以当饭吃，现在觉得还是饭好吃。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">6、幸亏现在走廊里都是声控和光控的灯，万一哪天整出个颜控灯，我可能要在漆黑的过道里从头走到尾。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">7、新认识了个朋友，感觉跟她特别聊得来。都坐了4小时了，她都还没有起身先买单的意思。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">8、我大腿的内侧有一个海螺的纹身，如果你把耳朵凑在我的海螺旁，我想你可以闻到大海的味道。。。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">9、现在卖器官的骗子很多，你们要小心。今天我就遇到一个卖桃子的，我尝桃子，刚刚要尝到第五个桃子的时候，卖桃子的说：要脸不，当时就吓到我了桃子都没买就走了。。。吓死宝宝了！！！</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">10、女孩子们都爱自拍，可是我却发现自拍容易修图难！</p></span></ul><p><br /></p>', '7', '0', '0', '0', '0', '2016-07-08 21:56:39', '0000-00-00 00:00:00', '8', '1', '1');
INSERT INTO `think_article` VALUES ('119', '17', '宁静致远', '爆囧:能把人整疯喽', '<ul style=\"margin:0px;padding:0px;list-style:none;font-size:14px;line-height:23px;white-space:normal;background-color:#ffffff;\"><span id=\"text110\" style=\"color:#333333\"><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">1、去小超市买水，给了收银员10块让他给我拿瓶绿茶。<br style=\"margin:0px;padding:0px;\" />收银员给我找了7块还给我一个瓶盖说：“没有绿茶了，你拿这个再来一瓶的盖子可以去对面商店换一瓶。”</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">2、余罪到老傅身边做卧底，老傅问：小子，你叫什么名字？<br style=\"margin:0px;padding:0px;\" />余罪老老实实的报出自己的假名：大哥，我叫余天龙，大家都叫我于小二。<br style=\"margin:0px;padding:0px;\" />话刚说完老傅就瞪着他：不&nbsp;，你不是于天龙。<br style=\"margin:0px;padding:0px;\" />余罪听到心里咯噔一下心想难道我暴露了？<br style=\"margin:0px;padding:0px;\" />老傅不管他继续说道：你是不是以为我没有看过《家有儿女》？你是刘星对不对？</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">3、有个二货好友特迷信，做什么事前必须看黄历，当他看到“不宜出门”后，又碍于自己有紧要的事情要办，没办法，只好翻墙出去。。。<br style=\"margin:0px;padding:0px;\" />结果，他的腿摔骨折了。。。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">4、刚才媳妇发条链接给我，标题是：“生活中夫妻的争吵，真的都是老公的错吗？&nbsp;深度好文，不容错过”。<br style=\"margin:0px;padding:0px;\" />我一看好感动，终于理解男人不容易了，平时这么多争争吵吵其实也都是一些小事，虽然女人容易情绪化，有时候也很可爱嘛，而且家里照顾的也很好啊。<br style=\"margin:0px;padding:0px;\" />思想波动了好久，点开链接，正文只有两个字：是的。。。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">5、一朋友问我：如果有一天他残疾了，你愿不愿意做我的拐杖？<br style=\"margin:0px;padding:0px;\" />我拍拍朋友肩膀说：我愿意！<br style=\"margin:0px;padding:0px;\" />朋友对我说：那我就用拐杖到厕所里捣屎玩。。。</p></span></ul><p><br /></p>', '9', '0', '0', '0', '0', '2016-07-08 21:57:09', '0000-00-00 00:00:00', '8', '1', '1');
INSERT INTO `think_article` VALUES ('120', '17', '宁静致远', '恨死人也笑死人的熊孩子', '<ul style=\"margin:0px;padding:0px;list-style:none;font-size:14px;line-height:23px;white-space:normal;background-color:#ffffff;\"><span id=\"text110\" style=\"color:#333333\"><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">1、某天我对老爸说：爸，等你女儿有钱，买两辆车。<br style=\"margin:0px;padding:0px;\" />当时我爸都快笑开花了说道：然后呢？<br style=\"margin:0px;padding:0px;\" />我不急不慢的说道：一辆我开给你看，还有一辆你看着我开，哈哈哈哈。。。。。<br style=\"margin:0px;padding:0px;\" />老爸。。。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">2、男友来我家吃饭，侄儿偷偷对我说：“姑姑，你这个男朋友没有上次来的那个帅。”<br style=\"margin:0px;padding:0px;\" />我说：“这个就是上次来的那个呀！”<br style=\"margin:0px;padding:0px;\" />侄儿一拍脑袋说：“天啊！这次他手里没拿着旺旺大礼包，我竟认不出来了！”</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">3、以前女儿踩到我，我装哭，她就会亲我一下，如今踩到我再装哭，她就再补踩我几下，是我演技下降了？还是你见识广了。。。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">4、老婆问老公，为什么结婚后不送我花了，老公说，你见过掉上来的鱼还喂鱼饵的？<br style=\"margin:0px;padding:0px;\" />老公被打了，儿子过来：命不好，掉上了一条鳄鱼。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">5、昨晚吃完了饭，我就让七岁的儿子把自己的碗洗了。<br style=\"margin:0px;padding:0px;\" />他极不情愿，愁眉苦脸的端着碗刚要往厨房走。突然像是想起了什么。<br style=\"margin:0px;padding:0px;\" />然后，把碗往桌子上一放，学着他妈的样子，一扭捏：“嗯。。。人家来事儿了，你去嘛！”<br style=\"margin:0px;padding:0px;\" />我。。。</p></span></ul><p><br /></p>', '11', '0', '0', '0', '0', '2016-07-08 21:57:44', '0000-00-00 00:00:00', '8', '1', '1');
INSERT INTO `think_article` VALUES ('121', '17', '宁静致远', '只要搞笑,越冷越好', '<ul style=\"margin:0px;padding:0px;list-style:none;font-size:14px;line-height:23px;white-space:normal;background-color:#ffffff;\"><span id=\"text110\" style=\"color:#333333\"><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">1、小桔子对爸爸说：爸，明天我要参加围棋比赛和对面的弥猴桃比。<br style=\"margin:0px;padding:0px;\" />爸爸：“孩子你要小心，听说它们还有个称号：棋艺果”</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">2、核桃仁无故被锤子砸得粉碎，核桃仁委屈的说：“我。。。我是个好仁。。。”<br style=\"margin:0px;padding:0px;\" />锤子：“对，对啊，好仁有好爆”<br style=\"margin:0px;padding:0px;\" />额。。。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">3、最近压力较大，上山找大师寻求解压良方。<br style=\"margin:0px;padding:0px;\" />大师：“施主压力来自何处？”<br style=\"margin:0px;padding:0px;\" />我：“来自工作。”<br style=\"margin:0px;padding:0px;\" />大师：“辞去工作，压力自然不在。”<br style=\"margin:0px;padding:0px;\" />我：“没了工作你让我喝西北风去啊？！”<br style=\"margin:0px;padding:0px;\" />大师：“不会的，绝对不会的。”<br style=\"margin:0px;padding:0px;\" />暗想大师定有高招，于是投去诉询问的目光。。。<br style=\"margin:0px;padding:0px;\" />大师：“看毛线看，难不成还不相信老衲？老衲研究天文多年，最近吹的定是东南风。”</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">4、一个人非常喜欢下棋，但是棋艺不精是俗话说的臭棋篓子。<br style=\"margin:0px;padding:0px;\" />一日下棋回来，老婆问：“谁输了？”<br style=\"margin:0px;padding:0px;\" />他说：“第一局我没赢，第二局他没输，第三局我要平棋他不干。”</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">5、两个傻子看着远去的火车。<br style=\"margin:0px;padding:0px;\" />傻子A：铁轨越远就越窄，那么大的火车也掉不下来，竟然还能走得很好！<br style=\"margin:0px;padding:0px;\" />傻子B：傻B，火车不是越走越小吗？</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">6、地铁上，几乎每个人都低头玩着手机，或游戏，或观剧，或聊天，不亦乐乎。<br style=\"margin:0px;padding:0px;\" />只有我和对面的一女孩冷眼相对：姑娘，你也是手机没电，开不了机了吧？</p></span></ul><p><br /></p>', '5', '0', '0', '0', '0', '2016-07-08 21:58:35', '0000-00-00 00:00:00', '8', '1', '1');
INSERT INTO `think_article` VALUES ('122', '17', '宁静致远', '爆笑之逗B剧场第九季', '<ul style=\"margin:0px;padding:0px;list-style:none;font-size:14px;line-height:23px;white-space:normal;background-color:#ffffff;\"><span id=\"text110\" style=\"color:#333333\"><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">1、我一直以为美若天仙这个词是在说我，原来并不是，倾国倾城才是！</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">2、我爱现任，但也爱前任，怎么办？在新版人民币和旧版人民币之间选择真的好难。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">3、谁说没有永远的？你们不是永远都不会在一起了吗？</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">4、男人可以矮可以穷可以丑，但是有一个地方绝对要大，那就是。。。心大。酱子又矮又穷又丑才能愉快的活下去。。。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">5、组长让我们带好吃饭的家伙到办公室集合，别人都带的笔记本。。。只有我带的碗和一双筷子。。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">6、凡事总往好处想，那么结果常常不尽如人意，所以遇事不妨先想想最坏的情况，万一实现了还能有“你看，我说一定能搞砸吧”的成就感，多开心。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">7、我不喜欢我喜欢的人喜欢我不喜欢的人，更不喜欢我不喜欢的人喜欢我喜欢的人&nbsp;，也不喜欢我喜欢的人不喜欢我喜欢的人。。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">8、本来开着空调盖着被子睡觉的，结果半夜被冷醒了，一看原来被子被老公全裹了，我这暴脾气冷静的把空调给关了。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">9、网上传的爆胎后不能急踩刹车，要紧握方向盘，慢慢到应急车道停车，这些都太麻烦，我一般是直接扛起来就走。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">10、当你说自己丑的时候其实是想让别人夸你说，你很好看啊。。。结果人家不仅认同了你丑还补刀：知道啦！我们又不瞎！</p></span></ul><p><br /></p>', '6', '0', '0', '0', '0', '2016-07-08 21:59:02', '0000-00-00 00:00:00', '8', '1', '1');
INSERT INTO `think_article` VALUES ('123', '17', '宁静致远', '笑爆,每对男女里都会有个二货', '<ul style=\"margin:0px;padding:0px;list-style:none;font-size:14px;line-height:23px;white-space:normal;background-color:#ffffff;\"><span id=\"text110\" style=\"color:#333333\"><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">1、我出差，今天二货女友问我：想我了没？<br style=\"margin:0px;padding:0px;\" />我说：你猜。<br style=\"margin:0px;padding:0px;\" />结果二货给了我个3选题：A.&nbsp;想了。B：A。C：B。多么霸气的选题。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">2、和女友散步，走着走着她问道：“你要带到哪儿去呀？”<br style=\"margin:0px;padding:0px;\" />我：“把你卖了”。<br style=\"margin:0px;padding:0px;\" />女友：“卖给我爸爸妈妈吧！”<br style=\"margin:0px;padding:0px;\" />我：“那把你妈妈号码告诉我，我给你妈发信息说：你女儿在我手上，明天中午之前我要儿到500万，不然。。。”<br style=\"margin:0px;padding:0px;\" />二货女友突然插嘴说：“不然你就等着抱孙子吧！！”<br style=\"margin:0px;padding:0px;\" />我。。。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">3、昨晚做梦梦到有人要给我2000万，条件是马上跟男友分手。<br style=\"margin:0px;padding:0px;\" />听到这话我当时就哭了，冲上去抱住她的大腿说：“你可一定要说话算话啊。”</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">4、有一天，屌丝问女神：“你为什么宁愿用黄瓜也不用我？”<br style=\"margin:0px;padding:0px;\" />女神没有回答只问了屌丝三个问题：“你有黄瓜长吗？你有黄瓜粗吗？你有黄瓜安全吗？”</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">5、步行街上，一对男女来到一个算命摊前，说：“算算我和我老公的感情吧。”<br style=\"margin:0px;padding:0px;\" />算命先生看看两人，沉思片刻，说：“恕我直言，你和你老公的感情已经走到尽头，没有必要再勉强下去了。”<br style=\"margin:0px;padding:0px;\" />女子松了口气，紧紧挽住男子的胳膊，柔声说：“听到了吧亲爱的，我们在一起吧，我回去就和我老公离婚。”</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">6、“我刚刚点的东西怎么还没来？”<br style=\"margin:0px;padding:0px;\" />“你有点什么？”<br style=\"margin:0px;padding:0px;\" />“我有点。。。喜欢你”</p></span></ul><p><br /></p>', '6', '0', '0', '0', '0', '2016-07-08 21:59:32', '0000-00-00 00:00:00', '8', '1', '1');
INSERT INTO `think_article` VALUES ('124', '17', '宁静致远', '一波搞笑的校园逗段', '<ul style=\"margin:0px;padding:0px;list-style:none;font-size:14px;line-height:23px;white-space:normal;background-color:#ffffff;\"><span id=\"text110\" style=\"color:#333333\"><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">1、贱货英语，毁我青春，拉我总分，伤我自尊。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">2、我的大学生活过得无牵无挂，我的意思是在大学里，我既没牵过手也没挂过科。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">3、在考试的时候一个恐怖的瞬间：别人都拿出计算器算题目了，可你根本不知道哪个地方需要用到计算器！</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">4、我妈让我不要跟学习比我差的同学玩，于是我去找学习委员。学习委员说：“我妈不让我跟学习比我差的同学玩。”</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">5、做为一个女学生，我的长相可以让我安静读书到毕业，可我这智商。。。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">6、之前都是长发，最近剪短了，朋友都说你的脖子怎么那么长，以前没发现啊。我说，都是以前考试抄答案抄的了。。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">7、一哥们儿去考雅思，看到题目的时候突然来了句“我日”，监考的老外懂一点汉语，就问“我日”是什么意思。这哥们儿来了句“这是我们在遇到困难的时候向太阳借助神力的呼唤。”</p></span></ul><p><br /></p>', '6', '0', '0', '0', '0', '2016-07-08 21:59:57', '0000-00-00 00:00:00', '8', '1', '1');
INSERT INTO `think_article` VALUES ('125', '17', '宁静致远', '爆囧,囧的脸上笑出朵花儿来!', '<ul style=\"margin:0px;padding:0px;list-style:none;font-size:14px;line-height:23px;white-space:normal;background-color:#ffffff;\"><span id=\"text110\" style=\"color:#333333\"><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">1、夏天打开冰箱拿出西瓜，切下一片咬一口后，第一感觉往往不是爽，而是菜刀又没洗。。。</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">2、去小卖部看到一个独自守店的老奶奶,银白色的头发,坐在小摇椅上睡着了。温温的阳光打在老奶奶的侧脸上,显得格外慈祥。<br style=\"margin:0px;padding:0px;\" />我拿了一瓶绿茶,放下三个硬币。<br style=\"margin:0px;padding:0px;\" />动静不敢太大,怕打扰到老奶奶休息。<br style=\"margin:0px;padding:0px;\" />我扭开瓶口的一刹那，奶奶猛地睁开眼睛说：“绿茶卖四块。”</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">3、被一个大妈骑着电瓶车，从后面撞倒了，疼的直流眼泪，大妈慌了!<br style=\"margin:0px;padding:0px;\" />在这时候突然跑过来个帅哥，特别紧张的关心我，能站起来吗？我点点头，然后帅哥愤怒的指责大妈，言辞犀利，我听不下去了“没什么事了！别为难大妈了，她也不是故意的”！<br style=\"margin:0px;padding:0px;\" />于是帅哥高兴的说“妈，没事了，不会讹人了，走！我载你回家！”</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">4、骗子给我办公室打电话，领导一老头接的，跟她闲扯了半个多小时。。。<br style=\"margin:0px;padding:0px;\" />领导挂了电话说，我这功力还是不行啊，才半个小时！能让她少骗一个人了吧？！</p><p style=\"padding:0px;margin-top:0px;margin-bottom:20px;\">5、老哥们儿一起去吃饭，吃了俩王八，又喝了一箱啤酒。<br style=\"margin:0px;padding:0px;\" />结账的时候，老板娘问服务员：“他们吃了什么？”<br style=\"margin:0px;padding:0px;\" />那服务业说：“俩王八喝了一箱啤酒。”<br style=\"margin:0px;padding:0px;\" />我们顿时都Hold不住了。。。正准备发飙呢，看到帐单上只算了啤酒的钱，王八钱没算。。。</p></span></ul><p><br /></p>', '9', '0', '0', '0', '0', '2016-07-08 22:00:25', '0000-00-00 00:00:00', '8', '1', '1');
INSERT INTO `think_article` VALUES ('126', '17', '宁静致远', '仁为万物之源', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 中国近代思想家&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;http://baike.baidu.com/view/1655.htm&quot; style=&quot;color: rgb(19, 110, 194); text-decoration: none; font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px; background-color: rgb(255, 255, 255);&quot;&gt;谭嗣同&lt;/a&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;提出的&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;http://baike.baidu.com/view/3330.htm&quot; style=&quot;color: rgb(19, 110, 194); text-decoration: none; font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px; background-color: rgb(255, 255, 255);&quot;&gt;哲学&lt;/a&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;命题。他在《仁学·界说》中说：“仁为天地万物之源，故&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;http://baike.baidu.com/view/714001.htm&quot; style=&quot;color: rgb(19, 110, 194); text-decoration: none; font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px; background-color: rgb(255, 255, 255);&quot;&gt;唯心&lt;/a&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;，故唯识”这是&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;http://baike.baidu.com/subview/1655/6672116.htm&quot; style=&quot;color: rgb(19, 110, 194); text-decoration: none; font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px; background-color: rgb(255, 255, 255);&quot;&gt;谭嗣同&lt;/a&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;“仁学”中的一个主要思想他用“仁”来宣传&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;http://baike.baidu.com/view/29095.htm&quot; style=&quot;color: rgb(19, 110, 194); text-decoration: none; font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px; background-color: rgb(255, 255, 255);&quot;&gt;资产阶级&lt;/a&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;的平等思想,说“仁以通为第一义”,而“通之象为平等”。哲学上他认为，“仁”是整个宇宙和社会最普遍、最高的统一法则。他在《仁学》中一开始即说:“学者第一当认明以太之体与用,始可与言仁”，“夫仁,以太之用”但在实际上他把“仁”看得比“以太”更根本。他吸收了宋儒“仁者,以天地万物为一体”的思想，把当时假设的“以太”媒介传导的性质完全归结为仁”,认为能不能“通天地万物人我为一身”,“惟其仁不仁”。因此他得出结论说：“天地间亦仁而已”。他的这一思想是受了佛学的影响。华严宗说：“三界唯心”；唯识宗说：“万法唯识”。谭嗣同认为“仁”作为万物之源，与佛教所说的“心”、“识”一样，所以说：“仁为天地万物之源，故唯心,故唯识”。此外,谭嗣同自称为康有为的“私淑弟子”，而&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;http://baike.baidu.com/view/1657.htm&quot; style=&quot;color: rgb(19, 110, 194); text-decoration: none; font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px; background-color: rgb(255, 255, 255);&quot;&gt;康有为&lt;/a&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;“以仁字为唯一宗旨”，认为“不忍人之心，仁也，电也，以太也，人人皆有之，……为万化之海，为一切根，为一切源”。谭嗣同的命题与此一致，具有&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;http://baike.baidu.com/view/6181.htm&quot; style=&quot;color: rgb(19, 110, 194); text-decoration: none; font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px; background-color: rgb(255, 255, 255);&quot;&gt;唯心主义&lt;/a&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;性质。&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '352', '0', '0', '0', '0', '2016-07-08 22:08:37', '2016-11-25 09:22:02', '7', '1', '1');
INSERT INTO `think_article` VALUES ('127', '17', '宁静致远', '天道自然', '&lt;p&gt;						&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;天道自然思想源于先秦道家。老子说“道之尊，德之贵，夫莫之命而常自然”，认为“道”是自然而然的。&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;http://baike.baidu.com/view/2760.htm&quot; style=&quot;color: rgb(19, 110, 194); text-decoration: none; font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px; background-color: rgb(255, 255, 255);&quot;&gt;庄子&lt;/a&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;也讲“天道”,认为“天道”是“无为”的,说“有天道,有人道。无为而尊者天道也;有为而累者人道也”。到战国末期，天道自然思想经过荀子的继承改造，变为积极进取的思想。荀子一方面反对目的论，强调“天行有常，不为尧存,不为桀亡”；一方面又反对宿命论,他提出“制天命而用之”，强调人可以认识和利用自然规律，人可以胜天。&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;					&lt;/p&gt;', '415', '0', '0', '0', '10', '2016-07-08 22:10:54', '2016-11-25 09:22:23', '7', '1', '1');
INSERT INTO `think_article` VALUES ('128', '41', '将来路远', '穷乐 穷点子', '&lt;p&gt;						&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(68, 68, 68); line-height: 25px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;穷人有穷乐儿，把富贵们打扁了也编不出来的乐儿。&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;\\&amp;quot;padding:0px;color:#444444;line-height:25px;font-family:宋体,&quot;&gt;　　在七十年代时，人们都不富裕。记得有位老光棍，家中一贫如洗。某天，村里来了位好看的落难女子，经人说合，女人就跟了他。人们起哄要他请客，他就斜起一只眼瞅瞅天，笑眯眯的咧开大嘴应承：“行行。咱是没糕面么，要是有些儿豆油是的，我就去借口锅，给你们大伙儿炸油糕吃啊!”&lt;/p&gt;&lt;p style=&quot;\\&amp;quot;padding:0px;color:#444444;line-height:25px;font-family:宋体,&quot;&gt;　　听听，请大伙吃糕?想想，什么都没有!&lt;/p&gt;&lt;p style=&quot;\\&amp;quot;padding:0px;color:#444444;line-height:25px;font-family:宋体,&quot;&gt;　　已不是光棍的光棍汉，一副穷相，可是从来见他是喜眉笑脸的，不但自己乐，还常常拿富人取乐。&lt;/p&gt;&lt;p style=&quot;\\&amp;quot;padding:0px;color:#444444;line-height:25px;font-family:宋体,&quot;&gt;　　有次，邻居家有亲戚从省城里来，是个大有钱人。晌午和一群村民围坐着瞎扯说笑话，他呢，一脸嬉笑却又不吭声，直直地盯着那人的脸不动，一会儿盯着那人的鼻子，而用手抠抠自己的鼻头，然后还是看着对方。接着盯住对方的嘴，又抠抠自己的嘴角。那人被盯的很不自在，不由得举起手也抠抠自己的鼻子，再抹一抹嘴角。他又皱起眉，往那人脸前凑了凑，然后往后退回，而且一下子把腰挺的直直的，并开始死命地抠自己的鼻孔，嘴里还不停地“唉，太丢人了，真是的!”那人一下脸红脖子粗，掏出手绢先是低下头使劲擦嘴角，而后转过身又使劲抠鼻孔。周围的人全愣了，都憋红了脸盯着那人，那人在众目睽睽之下，真是被逼到了无地自容!&lt;/p&gt;&lt;p style=&quot;\\&amp;quot;padding:0px;color:#444444;line-height:25px;font-family:宋体,&quot;&gt;　　那人还算老练，认为清理卫生了，认为无愧于众了，就镇定下来，想起什么似的向大家提问个什么话题。老光棍呢?也满是羞愧地把头扎到怀里。扎到怀里更滑稽，头是扎的，嘴是一撇一撇的，象是想要反驳几句什么似的，两只浑浊的耗子眼，不停地一翻一翻地斜着，仰望那人的耳背后，并把头与脖子也拧斜过去，且不由自主地抓住袖口，举起大袖子更使力地抽擦着自己耳根子下的脏脖子。这下，那人的脸腾地红了，瞪着大眼，泪都出来了，掏出手绢但没用，急慌中也如个放羊的小男孩般举起袖子使力擦着自己的脖子与耳根子：“老哥，您就快快告诉我吧，求您了，我是不是把鼻涕抹到脖子里啦?!”&lt;/p&gt;&lt;p style=&quot;\\&amp;quot;padding:0px;color:#444444;line-height:25px;font-family:宋体,&quot;&gt;　　几十号子村民，男女老幼那个乐啊，有的笑得直是雷声般嘟嘟放屁，有的笑得抱着胸使劲儿咳嗽，有笑蹲到地上，猛不叠又撑开裤裆，大伙儿又是一阵阵，一浪浪笑啊笑。我呢，举着自制的链子枪，对着放大屁的胖老婆子身后开了一枪，人们又是一阵子大笑。&lt;/p&gt;&lt;p style=&quot;\\&amp;quot;padding:0px;color:#444444;line-height:25px;font-family:宋体,&quot;&gt;　　说笑的人们有时会无缘无故说到一个丑人，然后大家是一顿有力批判，直到批判得再丑不能。这当间，不再是光棍的光棍汉就又不紧不慢跌凉话：“解放军里可有难看的呢，可是班长一个集合“立正”口令，齐刷刷的，一个比一个好看，可你等解散了再看，这个是肉包眼、大板牙，那个一脸疙瘩、红鼻头子。可难看咧……”&lt;/p&gt;&lt;p style=&quot;\\&amp;quot;padding:0px;color:#444444;line-height:25px;font-family:宋体,&quot;&gt;　　他的词儿往往一套一套的，人们还挑不了字眼儿。仔细琢磨琢磨，还有点朴实的美学在里头呢。&lt;/p&gt;&lt;p style=&quot;\\&amp;quot;padding:0px;color:#444444;line-height:25px;font-family:宋体,&quot;&gt;　　光棍汉穷了一辈子，老了还不花钱得一好看的女人。得女人的第三日，是我们郝桥村四月初八赶集会的日子。人们都在赶集时做些小买卖，但做什么或多或少也要本钱，他呢?穷的叮铛二啷响，那有什么本钱?不过，老光棍有斜招，在当街支了个三角木架子，把破被子往上一蒙搭了个棚，里面捂得黑洞洞的，只留了个小门帘儿，请人写块小牌子立着：“一个铜钱沾一沾，两个铜钱涮一涮”，然后往旁一坐是半语不发。&lt;/p&gt;&lt;p style=&quot;\\&amp;quot;padding:0px;color:#444444;line-height:25px;font-family:宋体,&quot;&gt;　　人们都好奇，问他里面到底有什么?他指指：“一个铜钱沾一沾”。人们更好奇，沾一沾?沾什么?不就一个铜钱么，给他。但是进去里面黑洞洞的什么也看不见，摸来摸去觉得地上有个小罐，猜想，兴许里面有好东西，用手一沾，粘糊糊的沾了一手指，举到鼻子下一闻：“啊呸!!”一个狗扑猫窜冲出来，准备与他发火。这不是光棍的光棍汉早有手语，指指脚底下的水盆，再指指“两个铜钱涮一涮”，那人只好忍气再掏两个铜钱涮一涮拉倒。围人问出来的人里面究竟有什么?出来的人苦笑着：“一个铜钱沾一沾，你们自己进去看!”&lt;/p&gt;&lt;p style=&quot;\\&amp;quot;padding:0px;color:#444444;line-height:25px;font-family:宋体,&quot;&gt;　　进去出来的，没一个说实情;围观好奇的，没一个不进去的。&lt;/p&gt;&lt;p style=&quot;\\&amp;quot;padding:0px;color:#444444;line-height:25px;font-family:宋体,&quot;&gt;　　已不是光棍的光棍汉，光凉水一天就换了十一盆。作者：北京荣宝画院&amp;nbsp;邵学军&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;					&lt;/p&gt;', '26', '0', '0', '0', '11', '2016-07-20 09:20:41', '2016-11-25 09:25:21', '8', '1', '1');
