INSERT INTO `think_article` VALUES ('156', '17', '宁静致远', ' MySQL查看表结构', '&lt;p&gt;						&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &amp;quot;microsoft yahei&amp;quot;; font-size: 15px; line-height: 35px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;在&lt;a href=&quot;http://lib.csdn.net/base/mysql&quot; class=&quot;replace_word&quot; title=&quot;MySQL知识库&quot; target=&quot;_blank&quot; style=&quot;text-decoration: none; color: rgb(223, 52, 52); font-weight: bold;&quot;&gt;MySQL&lt;/a&gt;的shell命令行下查询表的结构：&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &amp;quot;microsoft yahei&amp;quot;; font-size: 15px; line-height: 35px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;strong&gt;1.desc（描述）命令&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(85, 85, 85); font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 35px; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;desc tablename;&lt;br/&gt;describe tablename;&lt;br/&gt;&lt;strong&gt;2.show命令&lt;/strong&gt;&lt;br/&gt;show columns from tablename;&lt;br/&gt;show create table tablename&lt;br/&gt;&lt;strong&gt;3.select命令(SQL语句)&lt;/strong&gt;&lt;br/&gt;#查看表中所有列的信息&lt;br/&gt;use information_schema;&lt;br/&gt;select column_name from columns where table_name=&amp;#39;table_name&amp;#39;;&lt;br/&gt;#查看所有列的信息&lt;br/&gt;&lt;/span&gt;&lt;span style=&quot;color: rgb(85, 85, 85); font-family: &amp;quot;microsoft yahei&amp;quot;; font-size: 15px; line-height: 35px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &amp;quot;microsoft yahei&amp;quot;; font-size: 15px; line-height: 35px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;select column_name from columns where table_name=&amp;#39;table_name&amp;#39;;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: &amp;quot;microsoft yahei&amp;quot;; font-size: 15px; line-height: 35px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;--未完待续&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;					&lt;/p&gt;', '3', '0', '0', '0', '33', '2016-11-25 10:05:08', '2016-11-25 10:07:49', '4', '1', '1');
INSERT INTO `think_article` VALUES ('157', '17', '宁静致远', 'PHP foreach例子', '&lt;p&gt;下面的例子示范了一个循环，这个循环可以输出给定数组的值：&lt;/p&gt;&lt;p&gt;&amp;lt;html&amp;gt;&lt;/p&gt;&lt;p&gt;&amp;lt;body&amp;gt;&lt;/p&gt;&lt;p&gt;&amp;lt;?php&lt;/p&gt;&lt;p&gt;$arr=array(&amp;quot;one&amp;quot;, &amp;quot;two&amp;quot;, &amp;quot;three&amp;quot;);&lt;/p&gt;&lt;p&gt;foreach ($arr as $value)&lt;/p&gt;&lt;p&gt;{&lt;/p&gt;&lt;p&gt;echo &amp;quot;value: &amp;quot; . $value . &amp;quot;&amp;lt;br /&amp;gt;&amp;quot;;&lt;/p&gt;&lt;p&gt;}&lt;/p&gt;&lt;p&gt;?&amp;gt;&lt;/p&gt;&lt;p&gt;&amp;lt;/body&amp;gt;&lt;/p&gt;&lt;p&gt;&amp;lt;/html&amp;gt;&lt;/p&gt;&lt;p&gt;下面详细看一下详细说明&lt;/p&gt;&lt;p&gt;foreach ($array as &amp;amp;$row) {&lt;/p&gt;&lt;p&gt;$row = explode(&amp;#39;/&amp;#39;, $row);&lt;/p&gt;&lt;p&gt;}&lt;/p&gt;&lt;p&gt;foreach ($array as $row) {&lt;/p&gt;&lt;p&gt;//do something&lt;/p&gt;&lt;p&gt;}&lt;/p&gt;&lt;p&gt;这么写，在第二个循环会出逻辑错误，加入第二个循环中do something的地方是输出$row，循环到最后一个的时候的输出是倒数第二个元素，而不是最后一个&lt;/p&gt;&lt;p&gt;foreach ($array as &amp;amp;$row) {&lt;/p&gt;&lt;p&gt;$row = explode(&amp;#39;/&amp;#39;, $row);&lt;/p&gt;&lt;p&gt;}&lt;/p&gt;&lt;p&gt;unset($row);&lt;/p&gt;&lt;p&gt;foreach ($array as $row) {&lt;/p&gt;&lt;p&gt;//do something&lt;/p&gt;&lt;p&gt;}&lt;/p&gt;&lt;p&gt;或者第一个循环这么写&lt;/p&gt;&lt;p&gt;foreach ($array as $key =&amp;gt; $row) {&lt;/p&gt;&lt;p&gt;$array[$key] = explode(&amp;#39;/&amp;#39;, $row);&lt;/p&gt;&lt;p&gt;}&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '1', '0', '0', '0', '34', '2016-11-25 10:10:18', '0000-00-00 00:00:00', '5', '1', '1');
INSERT INTO `think_article` VALUES ('158', '17', '宁静致远', 'Linux的历史', '&lt;p style=&quot;font-family: Simsun; font-size: medium; white-space: normal; text-align: justify; text-indent: 21pt;&quot;&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;很多关于&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;的书籍在前面章节中写了一大堆东西来介绍&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;，可惜读者看了好久也没有正式开始进入&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;的世界，这样反而导致了他们对&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;失去了一些兴趣，而把厚厚的一本书丢掉&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;font-family: Simsun; font-size: medium; white-space: normal; text-align: justify; text-indent: 21pt;&quot;&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;Linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;的历史确实有必要让读者了解的，但是不了解也并不会影响你将来的&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;技术水平&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;哈哈，本人其实就不怎么了解&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;的历史，所以对于&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;的历史在本教程中不会涉及到&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;如果你感兴趣的话，那你去网上搜一下吧，一大堆呢足够让你看一天的&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;虽然我不太想啰嗦太多，但是关于&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;最基本的认识，我还是想简单介绍一下的&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;也算是我对&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;的创始人&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;Linus Torvalds&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;先生的尊重&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;font-family: Simsun; font-size: medium; white-space: normal; text-align: justify; text-indent: 21pt;&quot;&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;在介绍&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;的历史前，我想先针对大家如何对&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;的发音说一下&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;我发现我身边的朋友对&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;的发音大致有这么几种：&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;&amp;nbsp;“&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;里那克斯&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;”&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;与&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;“&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;里你克斯&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;”“&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;里扭克斯&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;”&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;等&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;其实官方的标准发音为&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;&amp;nbsp;[&amp;#39;li:n&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;эks]&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;，因为这个发音是创始人&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;Linus&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;的发音&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;如果你不认识这个音标，那么就读成&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;“&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;里那克斯&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;”。&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;而笔者习惯发音成&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;“&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;里你克斯&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;”&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;，当然你发音成什么，并没有人会说你，完全是一个人的习惯而已&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;font-family: Simsun; font-size: medium; white-space: normal; text-align: justify; text-indent: 21pt;&quot;&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;也许有的读者已经了解到，&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;和&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;unix&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;是非常像的&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;没错，&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;就是根据&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;unix&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;演变过来的&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;当年&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linus&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;就是因为接触到了&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;unix&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;而后才自己想开发一个简易的系统内核的，他开发的简易系统内核其实就是&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linux。&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;当时&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linus&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;把开发的这个系统内核丢到网上提供大家下载，由于它的精致小巧，越来越多的爱好者去研究它&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;人们对这个内核添枝加叶，而后成为了一个系统&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;也许你听说过吧，&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;是免费的&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;其实这里的免费只是说&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;的内核免费&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;在&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;内核的基础上而产生了众多&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;的版本&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;font-family: Simsun; font-size: medium; white-space: normal; text-align: justify; text-indent: 21pt;&quot;&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;Linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;的发行版说简单点就是将&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;Linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;内核与应用软件做一个打包&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;较知名的发行版有：&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;Ubuntu、RedHat、CentOS、Debain、Fedora、SuSE、OpenSUSE、TurboLinux、BluePoint、RedFlag、Xterm、SlackWare&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;等&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;font-family: Simsun; font-size: medium; white-space: normal; text-align: justify; text-indent: 21pt;&quot;&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;而笔者常用的就是&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;Redhat&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;和&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;&amp;nbsp;CentOS&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;，这里有必要说一下，其实&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;CentOS&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;是基于&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;Redhat&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;的，网上有人说，&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;Centos&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;是&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;Redhat&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;企业版的克隆&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;笔者所在公司的服务器全部都是安装&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;CentOS&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;系统，并且相当稳定&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。CentOS&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;较之于&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;Redhat&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;可以免费使用&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;yum&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;下载安装所需要的软件包，这个是相当方便的&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;而&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;Redhat&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;要想使用&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;yum&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;必须要购买服务了&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;font-family: Simsun; font-size: medium; white-space: normal; text-align: justify; text-indent: 21pt;&quot;&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;笔者只是简单的介绍了一下&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;，如果你想详细了解&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;linux&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 10.5pt;&quot;&gt;的历史，那么请自己去查询一下相关的资料吧&lt;/span&gt;&lt;span style=&quot;font-family: Calibri; font-size: 10.5pt;&quot;&gt;。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '1', '0', '0', '0', '35', '2016-11-25 10:13:03', '0000-00-00 00:00:00', '6', '1', '1');
INSERT INTO `think_article` VALUES ('152', '17', '宁静致远', '爱的信仰', '&lt;p&gt;						&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: 宋体, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 30px; background-color: rgb(255, 255, 255);&quot;&gt;&amp;nbsp; 会不会渴望冬的&lt;/span&gt;&lt;a href=&quot;http://zw.liuxue86.com/yangguang/&quot; target=&quot;_blank&quot; style=&quot;font-family: 宋体, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 30px; margin: 0px; padding: 0px; text-decoration: none; color: rgb(102, 102, 102);&quot;&gt;阳光&lt;/a&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: 宋体, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 30px; background-color: rgb(255, 255, 255);&quot;&gt;，若你不再身旁?能不能踏上&lt;/span&gt;&lt;a href=&quot;http://zw.liuxue86.com/mengxiang/&quot; target=&quot;_blank&quot; style=&quot;font-family: 宋体, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 30px; margin: 0px; padding: 0px; text-decoration: none; color: rgb(102, 102, 102);&quot;&gt;梦想&lt;/a&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: 宋体, Arial, Helvetica, sans-serif; font-size: 14px; line-height: 30px; background-color: rgb(255, 255, 255);&quot;&gt;的天堂，跟着你的信仰?&amp;nbsp;&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 10px; margin-bottom: 0px; padding: 0px; font-size: 14px; font-family: 宋体, Arial, Helvetica, sans-serif; line-height: 30px; color: rgb(51, 51, 51); white-space: normal; text-align: left; background-color: rgb(255, 255, 255);&quot;&gt;　　当心灵交汇的瞬间，寂寞苍穹的深处，那是眼睛看不到的地方，可一双眼睛却总是在深深的凝望，那里有着心灵的渴望，那是梦想的天堂，爱情对于现代的我们，是否是个奢侈的字眼?我们用尽一身的力量，爱情，最终成为&lt;a href=&quot;http://zw.liuxue86.com/jiyi/&quot; target=&quot;_blank&quot; style=&quot;margin: 0px; padding: 0px; text-decoration: none; color: rgb(102, 102, 102);&quot;&gt;记忆&lt;/a&gt;的过往，和心灵深处的渴望。&lt;/p&gt;&lt;p style=&quot;margin-top: 10px; margin-bottom: 0px; padding: 0px; font-size: 14px; font-family: 宋体, Arial, Helvetica, sans-serif; line-height: 30px; color: rgb(51, 51, 51); white-space: normal; text-align: left; background-color: rgb(255, 255, 255);&quot;&gt;　　可是，是什么让&lt;a href=&quot;http://zw.liuxue86.com/gybs/&quot; target=&quot;_blank&quot; style=&quot;margin: 0px; padding: 0px; text-decoration: none; color: rgb(102, 102, 102);&quot;&gt;悲伤&lt;/a&gt;的事情四处逃亡，是什么让心里温热而馨香，即使没有相拥的温度，即使没有相缠的眼眸，当心灵交汇的瞬间，仿佛找到停靠的港，温馨而&lt;a href=&quot;http://zw.liuxue86.com/gywn/&quot; target=&quot;_blank&quot; style=&quot;margin: 0px; padding: 0px; text-decoration: none; color: rgb(102, 102, 102);&quot;&gt;温暖&lt;/a&gt;，从此风雨不再侵袭，从此风霜何惧?我们一同徜徉，一同畅想，一同深深渴望，我们信仰着我们的信仰，我们爱上我们最纯真的爱情梦想。&lt;/p&gt;&lt;p style=&quot;margin-top: 10px; margin-bottom: 0px; padding: 0px; font-size: 14px; font-family: 宋体, Arial, Helvetica, sans-serif; line-height: 30px; color: rgb(51, 51, 51); white-space: normal; text-align: left; background-color: rgb(255, 255, 255);&quot;&gt;　　会不会渴望冬的阳光，若你不在身旁?会不会踏上梦想的天堂，跟着你的信仰?茫茫尘世，爱情若有若无，爱情她是否来过?我们有疑惑，有迷茫，纵然是苦思冥想，无法停止心里的彷徨，是什么触动深藏的心音，是什么牵动最深的情肠，让心有所依，让心灵不再游荡。&lt;/p&gt;&lt;p style=&quot;margin-top: 10px; margin-bottom: 0px; padding: 0px; font-size: 14px; font-family: 宋体, Arial, Helvetica, sans-serif; line-height: 30px; color: rgb(51, 51, 51); white-space: normal; text-align: left; background-color: rgb(255, 255, 255);&quot;&gt;　　历尽&lt;a href=&quot;http://zw.liuxue86.com/kunan/&quot; target=&quot;_blank&quot; style=&quot;margin: 0px; padding: 0px; text-decoration: none; color: rgb(102, 102, 102);&quot;&gt;苦难&lt;/a&gt;，无法停止心中的梦想，历尽沧桑，无法磨灭心中的渴望，相思的情愫，爱恨的情殇，都凝聚成心里最深的凝想，走遍千山望穿心涯，爱情，它来到我们心上，它让悲伤的事情四处逃亡，它让心灵不再游荡 ，爱情它不是朝朝暮暮，它不是耳鬓厮磨，它是我们爱上的一个梦想。&lt;/p&gt;&lt;p style=&quot;margin-top: 10px; margin-bottom: 0px; padding: 0px; font-size: 14px; font-family: 宋体, Arial, Helvetica, sans-serif; line-height: 30px; color: rgb(51, 51, 51); white-space: normal; text-align: left; background-color: rgb(255, 255, 255);&quot;&gt;　　会不会望冬的阳光，若你不在身旁?能不能踏上梦的天堂，跟着你的信仰?爱情是海洋，爱情是温柔的港，爱情是你的信仰我的信仰，连接起我们的梦想和渴望，爱情，是我们今生的渴望，爱情，是我们今生不变的信仰。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;					&lt;/p&gt;', '367', '0', '0', '0', '29', '2016-11-17 17:04:46', '2016-11-25 09:45:33', '7', '1', '1');
