INSERT INTO `think_article_type` VALUES ('2', 'javascript', '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;JavaScript是一种属于网络的脚本语言,已经被广泛用于Web应用开发,常用来为网页添加各式各样的动态功能,为用户提供更流畅美观的浏览效果。通常JavaScript脚本是通过嵌入在HTML中来实现自身的功能的。<br>');
INSERT INTO `think_article_type` VALUES ('3', 'jQuery', '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;JQuery是继prototype之后又一个优秀的Javascript库。它是轻量级的js库 ，它兼容CSS3，还兼容各种浏览器（IE 6.0+, FF 1.5+, Safari 2.0+, Opera 9.0+），jQuery2.0及后续版本将不再支持IE6/7/8浏览器。jQuery使用户能更方便地处理HTML（标准通用标记语言下的一个应用）、events、实现动画效果，并且方便地为网站提供AJAX交互。jQuery还');
INSERT INTO `think_article_type` VALUES ('4', 'MySQL', '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;MySQL是一个关系型数据库管理系统，由瑞典MySQL AB 公司开发，目前属于 Oracle 旗下公司。MySQL 最流行的关系型数据库管理系统，在 WEB 应用方面MySQL是最好的 RDBMS (Relational Database Management System，关系数据库管理系统) 应用软件之一。');
INSERT INTO `think_article_type` VALUES ('5', 'PHP', '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;PHP（外文名:PHP: Hypertext Preprocessor，中文名：“超文本预处理器”）是一种通用开源脚本语言。语法吸收了C语言、Java和Perl的特点，利于学习，使用广泛，主要适用于Web开发领域。PHP 独特的语法混合了C、Java、Perl以及PHP自创的语法。它可以比CGI或者Perl更快速地执行动态网页。用PHP做出的动态页面与其他的编程语言相比，PHP是将程序嵌入到HTML（标准通用标记语言下的一');
INSERT INTO `think_article_type` VALUES ('6', 'Linux', '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Linux是一套免费使用和自由传播的类Unix操作系统，是一个基于POSIX和UNIX的多用户、多任务、支持多线程和多CPU的操作系统。它能运行主要的UNIX工具软件、应用程序和网络协议。它支持32位和64位硬件。Linux继承了Unix以网络为核心的设计思想，是一个性能稳定的多用户网络操作系统。');
INSERT INTO `think_article_type` VALUES ('7', '百科全书', '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;百科全书是概要记述人类一切知识门类或某一知识门类的工具书 。百科全书在规模和内容上均超过其他类型的工具书。百科全书的主要作用是供人们查检必要的知识和事实资料，其完备性在于它几乎包容了各种工具书的成分，囊括了各方面的知识。被誉为“没有围墙的大学”。');
INSERT INTO `think_article_type` VALUES ('8', '笑话故事', '&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;人类历史上，人自从有了语言，就已经出现了开玩笑的语言，最早人们以口相传，后来有了文字，许多笑话便被记载下来，编书成册，形成了许多经典的笑话故事。笑话是一种经过艺术加工的语言形式,是艺术化的语言，笑话是一种艺术方法，用这种方法造成以笑为艺术手段的文学艺术作品。');
